import React from 'react';
import './searchBox.style.css'

const searchBox = function({placeholder, onchangefunction}){
    return(
        <input 
          type='search' 
          placeholder={placeholder}
          onChange={e=> {
            this.setState({onchangefunction})
            } 
          }></input>
    )
}
